import React from "react";
import { StyleSheet} from 'react-native';

export const globalStyle = StyleSheet.create(
    {
        main:{
            flex:1,
            marginTop:7,
            padding: 5
        },
        title:{
            fontSize: 25,
            color: '#333',
            fontFamily:'mt-bold',
            textAlign:'center'
        }
    }
)
